import React from "react";
import { FaWhatsapp, FaEnvelope, FaPhone } from "react-icons/fa";

export default function ContactFloat() {
  const phone = "+919987120563"; // update with your number

  return (
    <div className="fixed right-4 bottom-6 flex flex-col gap-3 z-50">
      {/* WhatsApp */}
      <a
        href={`https://wa.me/${phone.replace(/\D/g, "")}`}
        target="_blank"
        rel="noreferrer"
        className="w-12 h-12 rounded-full bg-green-500 flex items-center justify-center text-white shadow-lg hover:scale-110 transition-transform duration-200"
        title="Chat on WhatsApp"
      >
        <FaWhatsapp size={22} />
      </a>

      {/* Email */}
      <a
        href="mailto:care.emblemedcare@gmail.com"
        className="w-12 h-12 rounded-full bg-gray-700 flex items-center justify-center text-white shadow-lg hover:scale-110 transition-transform duration-200"
        title="Send an Email"
      >
        <FaEnvelope size={20} />
      </a>

      {/* Call */}
      <a
        href={`tel:${phone}`}
        className="w-12 h-12 rounded-full bg-blue-600 flex items-center justify-center text-white shadow-lg hover:scale-110 transition-transform duration-200"
        title="Call Us"
      >
        <FaPhone size={20} />
      </a>
    </div>
  );
}
